import React from "react";
import "./App.scss";
import "./assets/css/index.css";
import Header from "./components/Header/Header";
import Xtest from "./components/Xtest/Xtest";
import {
  BrowserRouter,
  Switch,
  Route,
  Routes,
  Link,
  NavLink,
} from "react-router-dom";
import gen_modelsShowContainer from "./components/GenModelsHello/";

function App(props) {
  //debugger
  return (
    <BrowserRouter>
      <div className="app-wrapper">
        <Header />

        <main className="maincontent">
          <Routes>
            {/* profile/:userId? опциональный */}
            <Route
              path="/gen_modelsshow"
              element={<gen_modelsShowContainer />}
            />
            <Route path="/xtest" element={<Xtest />} />
          </Routes>
        </main>
      </div>
    </BrowserRouter>
  );
}

//new page

const News = () => {
  return <h2>Here's News</h2>;
};
const Hello = () => {
  return <h2>Here's Helloooo!!!! I'm in processing...</h2>;
};
const NotFound = () => {
  return <h2>Error 404! Not Found Page</h2>;
};

export default App;
